import React from 'react';
import {Form, Row, Input, Layout} from 'antd';
import '../../src/Styles/Login.css';
const { Header } = Layout;

const Login = () => {
    

    return(
        <div style={{backgroundColor: '#E8C10F'}}>
            <div className="circle-background" style={{position: 'absolute', marginTop:'180px', marginLeft:'30px'}}></div>
            <Row justify="center" style={{ flexGrow: 1, padding: '35px', textAlign: 'center' }}>
                <Form
                name="basic"
                initialValues={{ remember: true }}
                layout="vertical"
                style={{ padding: '8px', borderRadius: '20px'}}
                >
                    <img className="ImgLogin" src="https://cdn-icons-png.flaticon.com/512/272/272456.png" alt="Icono Register"></img>
                    <Form.Item
                    label="Correo Electronico"
                    name="Correo_Electronico"
                    rules={[{ required: true, message: 'Por favor ingresa tu nombre!' }]}
                    >
                        <Input />
                    </Form.Item>
                    <Form.Item
                    label="Contraseña"
                    name="Contraseña"
                    rules={[{ required: true, message: 'Por favor ingresa tu contraseña!' }]}
                    >
                        <Input.Password />
                    </Form.Item>
                </Form>

            </Row>
            <Layout>
        <Header style={{ backgroundColor: '#26799B', textAlign: 'center' }}>
          <p className="TextFooter">Cesvi Mexico ©</p>
        </Header>
      </Layout>
        </div>
    );
}

export default Login;
